# Possible to add your own references by using the draw_ref.py tool and copy pasting the terminal output under a new reftype.
import numpy as np
def make_path(reftype= "figure8", N_STEPS = 500, sampletime = 0.1, circle_radius = 30, circle_laps = 1, figure8_radius = 30, figure8_laps = 2, line_velocity_kmh = 20, line_angle_deg = 90):
    xref_list = []
    yref_list = []
    
    if reftype == "figure8+Sylinder":
        for i in range(N_STEPS):       
            t = i * sampletime
            if t < 20:
                # Infinity symbol
                t = t * (2*np.pi) * 50/19 / (N_STEPS * sampletime)
                a = 20
                xref_list.append(a * np.sin(t))
                yref_list.append(a/2 * np.sin(2*t))
            elif t < 30:
                #Linje
                t = t - 20
                xref_list.append(10.0)
                yref_list.append(8 + 10/2*t)
            elif t < 40:
                # Sirkel
                t = (t - 30)
                r = 10
                w = (3*np.pi)/10 
                xref_list.append(r*np.cos(t*w))
                yref_list.append(60 + r*np.sin(t*w))
            elif t <= 49:
                # Linje
                t = t - 40
                xref_list.append(-10.0)
                yref_list.append(60 - 52/9*t)
            elif t <= 50:
                # Linje
                t = t - 49
                xref_list.append(-10.0 + 5*t)
                yref_list.append(8 - 5*t)
        return [xref_list, yref_list]
    if reftype == "circle":
        for i in range(N_STEPS):       
            rotasjon = (2*np.pi) * circle_laps /N_STEPS
            xref_list.append(circle_radius*np.cos(i*rotasjon) - circle_radius)
            yref_list.append(circle_radius*np.sin(i*rotasjon)) 
        return [xref_list, yref_list]
    
    if reftype == "figure8":    
        for i in range(N_STEPS): 
            t = i * sampletime
            t = t * (2*np.pi) * figure8_laps / (N_STEPS * sampletime)
            xref_list.append(figure8_radius * np.sin(t))
            yref_list.append(figure8_radius/2 * np.sin(2*t))
        return [xref_list, yref_list]
    
    if reftype == "line_with_bend":
        for i in range(N_STEPS):
            t = i * sampletime
            vel = line_velocity_kmh/3.6
            line_angle = line_angle_deg * np.pi/180
            if t <= 10:
                xref_list.append(vel * t)
                yref_list.append(0.0)
            else:
                t = t-10
                xref_list.append(vel * 10 + np.cos(line_angle)*vel*t)
                yref_list.append(np.sin(line_angle)*vel*t)
        return [xref_list, yref_list]
    
    if reftype == "straight_line":
        for i in range(N_STEPS):
            t = i * sampletime
            vel = line_velocity_kmh/3.6
            line_angle = 30 * np.pi/180
            xref_list.append(np.cos(line_angle)*vel*t)
            yref_list.append(np.sin(line_angle)*vel*t)
        return [xref_list, yref_list]
    
    
    if reftype == "racetrack":
        for i in range(781): 
            t = i * sampletime
            if t < 10:
                xref_list.append(30/3.6 * t)
                yref_list.append(0.0)
            elif t < 12.83:
                t = (t-12.83)
                xref_list.append(83.33 + 10*np.cos(-0.556*t))
                yref_list.append(10*np.sin(-0.556*t) - 10)
            elif t < 20:
                t = (t-12.837)
                xref_list.append(93.33)
                yref_list.append(-10 -  20/3.6 * t)
            elif t < 28.48:
                t = (t-14.35)
                xref_list.append(93.33 + 10 + 10*np.cos(0.556*t))
                yref_list.append(-49.7 + 10*np.sin(0.556*t))
            elif t < 32:
                t = (t-28.48)
                xref_list.append(103.33 - 25/3.6*t)
                yref_list.append(-39.79)
            elif t < 49:
                t = (t - 32)
                for j in range(2):
                    t_i = t + j * sampletime/2
                    xref_list.append(78.88 - 20 / 3.6 * t_i)
                    yref_list.append(-39.79 - 7 * np.sin((2 * np.pi / 40) * (1 - 5.5) * t_i))
            elif t < 55:
                t = (t-49)
                xref_list.append(-15.6 - 4.5*t)
                yref_list.append(-43.4 + 3.3*t)
            elif t < 59.67:
                t = (t-55)
                xref_list.append(-42.6+ 3.3*t)
                yref_list.append(-23.6 + 4.5*t)
            elif t < 61.39:
                t = (t-67.19)
                xref_list.append(-17.5 +20*np.cos(-0.276*t))
                yref_list.append(-20 + 20*np.sin(-0.276*t))
            elif t < 63.54:
                t = (t-61.39)
                xref_list.append(-18.09+30/3.6*t)
                yref_list.append(0.0)
        return [xref_list, yref_list]
    
